import React from "react";
import Navigation from "../../../global-components/Navigation/Navigation";
import PageStyles from "../styles/active-user-styles.module.scss";


function ActiveUserMainPage() {
  return (
    <div className={PageStyles.activeMainPagewrapper}>
      <div className={PageStyles.navWrapper}>
        <Navigation color="#FFFFFF" pageName={"Подписки"} />
      </div>
      <section className={PageStyles.cashbackActiveServiceWrapper}>
        <div className={PageStyles.gridContainer}>
          <div className={PageStyles.gridItem + ' ' + PageStyles.periodCashback}>
            <div className={PageStyles.icon}>icon</div>
            <div className={PageStyles.text}>Кешбэк за весь период</div>
            <div className={PageStyles.amount}>+ 1496 ₽</div>
          </div>
          <div className={PageStyles.gridItem + ' ' + PageStyles.monthCashback}>
            <div className={PageStyles.text}>Кешбэк в этом месяце</div>
            <div className={PageStyles.amount}>+ 496 ₽</div>
          </div>
          <div className={PageStyles.gridItem + ' ' + PageStyles.monthExpenses}>
            <div className={PageStyles.text}>Расходы в этом месяце</div>
            <div className={PageStyles.amount}>- 1296 ₽</div>
          </div>
        </div>
      </section>

    </div>
  );
}

export default ActiveUserMainPage;
